import '../../data/models/admin_wallet_dto.dart';import 'admin_wallet.dart';import 'body_admin_wallet.dart';import 'footer_admin_wallet.dart';import 'header_admin_wallet.dart';class PendingPayedAdminWallet {  PendingPayedAdminWallet({    this.header,    this.body,    this.footer,  });  HeaderAdminWallet? header;  List<BodyAdminWallet>? body;  FooterAdminWallet? footer;  factory PendingPayedAdminWallet.fromDto(PendingPayedAdminWalletDto json) {    return PendingPayedAdminWallet(      header: HeaderAdminWallet.fromDto(json.header!),      footer: FooterAdminWallet.fromDto(json.footer!),      body: json.body?.map((e) => BodyAdminWallet.fromDto(e)).toList(),    );  }}